import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">NexGenHome</a> {/* No hover hand and finger */}
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link className="nav-link active" aria-current="page" to="/rooms">Home</Link> {/* Navigate to Rooms */}
            </li>
            <li className="nav-item dropdown">
              <a className="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                Select a room
              </a>
              <ul className="dropdown-menu">
                <li><Link className="dropdown-item" to="/living-room">Living Room</Link></li>
                <li><Link className="dropdown-item" to="/bedroom">Bedroom</Link></li>
                <li><Link className="dropdown-item" to="/kitchen">Kitchen</Link></li>
                <li><Link className="dropdown-item" to="/bathroom">Bathroom</Link></li>
                <li><Link className="dropdown-item" to="/office">Office</Link></li>
                <li><Link className="dropdown-item" to="/dining-room">Dining Room</Link></li>
              </ul>
            </li>
          </ul>
          <form className="d-flex" role="search">
            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            <button className="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
